@zoee16328 said on 5/12/23
I feel like if you also understood the meaning behind Sonogong and its choreography, it's even more of a masterpiece. This song references to a great piece of literature. The Korean name of this song is "손오공 (son-ogong)" is a mythical figure and the main character of the 16th century Chinese novel Journey to the West. Most commonly known as the monkey king, or Sun Wukong in Chinese. In the story, he is like a powerful superhero who protects hist team all the way from China to India to bring back the Buddhist Scriptures. During this trip, they encountered many hardships and dangers but conquered them one by one. The part where the dancers created two mounds and hopped from one mound to the other represents the monkey's personality. "Hop on our cloud and get all around" in the lyric is a reference to his ability to travel interstellar distances with his flying cloud - which is when S.Coups was lifted and passed from the back to the front in the air. The incantation in the lyric might reference to the spell that the Tang monk uses to restrain him from his rebellious nature. In Joshua's line, the "power pole" is his weapon, which can transform extremely big or small. The choreography at the end is a simulation of Wukong's power and making copies of himself with his fur to form an army. There are many more references and great parts of the choreography with meaning and understanding what they refer to makes this even more of a masterpiece.
